*/
const Box = styled.div``
const Floor = ({}) => <div>
    <div>

    </div>
</div>

const Floors = ({floors}) => <Container className="p-3">{
    floors.map((floor,i,a) => i % 2 === 0 && (
        a[i+1] != undefined ? 
            <Row style={{"justify-content":"space-evenly"}}  className="mb-3 d-flex">
                <Floor className="col-5" floor={floor}/>
                <Floor className="col-5" floor={a[i+1]}/>
            </Row> 
            : 
            <Row className="col-12">
                <Floor className="col-12" floor={floor}/>
            </Row>
        )
    )
}</Container>

export default Floors;
